レプソルは世界１１カ国に良質なオイルガス油田を持つ、総合石油企業です
単に原油を精製するだけでなく、その探査・採掘からガソリンをはじめとする
石油製品の生産、一貫して手掛け、国際的に最高水準のテクノロジーセンターも
保有しています。欧州車メーカーにも支持されているレプソルオイルの高品質は
良質なベースオイルと高い技術力に裏付けされています。
